import React from 'react';
import Stock from '../../images/stock_ticker.png'
import '../pages/Project.css';
import Statz from '../../images/Statz_Tracker.png'

function Projects() {
  return (
    <div>
      <h1 className='project-header'>Projects</h1>
      <section class="label">
        <a className='stoxster-card' href='https://wissamk08.github.io/BootCampProject-01/'>
          <img src={Stock} alt="Picture of Stock Ticker Website" />
          <button><a href="https://github.com/wissamk08/BootCampProject-01">GitHub</a></button>
        </a>
      </section>
      <section class="label">
        <a className='stat-tracker-card' href=''>
          <img src={Statz} alt="Picture of Stat Tracker Application" />
          <button><a href="https://github.com/wissamk08/BootCampProject-01">GitH</a></button>
        </a>
      </section>
    </div >
  );
}

export default Projects;
